import styled from "styled-components";

export const CardContainer = styled.div`
  height: 216px;
  width: 384px;
  background: red;
`;

export const CardTop = styled.div`
  display: flex;
  flex-direction: row;
  height: 20px;
  width: 384px;
  background: #111;
`;

export const CardDot = styled.div`
  margin-left: 3px;
  height: 8px;
  width: 8px;
  border-radius: 4px;
  background: red;
`;

export const CardBar = styled.div`
    height: 8px;
    width 150px;
    background: #fff;
`;

export const CardBg = styled.div`
  height: 108px;
  width: 250px;
  background: pink;
`;

export const CardBtn = styled.button`
  border: none;
`;
